def circular_shift(x, shift):
    x_str = str(x)
    num_digits = len(x_str)
    shift %= num_digits

    if shift == 0:
        return x_str

    dq = deque(x_str)
    dq.rotate(shift)

    if shift > num_digits // 2:
        return ''.join(dq)
    else:
        dq.reverse()
        return ''.join(dq)

