from typing import List

def smallest_change(arr: List[int]) -> int:
    n = len(arr)
    dp = [[0 for _ in range(n)] for _ in range(n)]

    for l in range(2, n+1):
        for i in range(n-l+1):
            j = i + l - 1
            if arr[i] == arr[j]:
                dp[i][j] = dp[i+1][j-1]
            else:
                dp[i][j] = min(dp[i+1][j], dp[i][j-1]) + 1

    return dp[0][n-1]

